import React, { CSSProperties } from 'react'

export interface StylesDictionary {
  [Key: string]: CSSProperties;
}

const styles: StylesDictionary = {
  myHeader: {
    display: 'flex',
    justifyContent: 'center',
    height: "4em",
    width: '100%',
    backgroundColor: '#525f7f',
    top: 0,
    zIndex: 10,
    position: 'fixed',
    verticalAlign: 'middle',
    border: 'solid 1px'
  }
}

export default function NavBar() {
  return (
    // <nav className="navbar navbar-dark primary-color">
    //   {/* // <nav className="navbar navbar-light blue lighten-4"> */}
    //   <a className="navbar-brand" href="/">
    //     <img className="" src="/images/meow.png" height="40" alt="meow logo" />
    //   </a>
    // </nav>
    <>
      <div className="navbar navbar-expand-lg navbar-absolute" style={styles.myHeader}>
        <img className="" src="/images/meow.png" height="40" alt="meow logo" />
      </div>
      <nav className="navbar navbar-expand-lg navbar-absolute navbar-transparent align-" >
        <div id="home" className="container-fluid">
          <div className="navbar-wrapper">
            <div className="navbar-toggle d-inline">
              <button type="button" className="navbar-toggler" data-toggle="collapse" data-target="#navigation">
                <span className="navbar-toggler-bar bar1"> </span>
                <span className="navbar-toggler-bar bar2"> </span>
                <span className="navbar-toggler-bar bar3"> </span>
              </button>
            </div>
          </div>
          <div className="collapse navbar-collapse" id="navigation" style={{ backgroundColor: "black" }}>
            <ul className="navbar-nav ml-auto">
              <li className="dropdown nav-item" ><a href="#home"><p className="d-lg-none">Test</p></a></li>
              <li className="dropdown nav-item" ><a href="#home"><p className="d-lg-none">Test</p></a></li>
              <li className="dropdown nav-item" ><a href="#home"><p className="d-lg-none">Test</p></a></li>
              <li className="dropdown nav-item" ><a href="#home"><p className="d-lg-none">Test</p></a></li>
            </ul>
          </div>
        </div>
      </nav>
    </>
  )
}
